      name: "rmd-theme-tone",
      type: "function",
      description:
        "Determines if a provided color is considered light or dark.\n\n",
      file: "@react-md/theme/dist/_color-a11y.scss",
      group: "theme",
      see: [],
      links: [
        {
          url: "https://www.w3.org/TR/WCAG20/#visual-audio-contrast-contrast",
          caption: "",
        },
      ],
      code:
        "@function rmd-theme-tone($color: , $min-contrast: $rmd-theme-default-contrast-ratio) {\n  @if $color == 'dark' or $color == 'light' {\n    @return $color;\n  }\n\n  $light-contrast: rmd-theme-contrast($color, $rmd-white-base);\n  $dark-contrast: rmd-theme-contrast($color, rgba($rmd-black-base, 0.87));\n\n  @if ($light-contrast < $min-contrast) and ($dark-contrast > $light-contrast) {\n    @return 'light';\n  } @else {\n    @return 'dark';\n  }\n}",
      oneLineCode:
        "@function rmd-theme-tone($color: , $min-contrast: $rmd-theme-default-contrast-ratio) {  }",
      throws: [],
